function sortInterestingValues(values) {
  const interestingValues = [];
  const nonInterestingValues = [];
  values.forEach((value) => {
    if (value == null || value === '') {
      nonInterestingValues.push(value);
    } else {
      interestingValues.push(value);
    }
  });
  return interestingValues.concat(nonInterestingValues);
}

module.exports.sortInterestingValues = sortInterestingValues;
